import React from 'react';
import { AppBar, Toolbar, Typography, IconButton } from '@mui/material';
import HelpOutlineIcon from '@mui/icons-material/HelpOutline';
import SettingsIcon from '@mui/icons-material/Settings';
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';

const iconButtonClasses = `
  bg-white mr-2
  transition-all duration-200 ease-in-out
  hover:bg-sky-400 hover:shadow-xl
  hover:-rotate-6 hover:scale-110 hover:text-sky-900
  shadow-sm
  rounded-full
  animate-none
  focus:outline-none
`;

const Header: React.FC = () => {
  return (
    <AppBar position="static" sx={{ background: 'linear-gradient(90deg,rgb(69, 79, 255) 65%,rgb(13, 25, 112) 85%)' }}>
      <Toolbar>
        <Typography variant="h6" sx={{ flexGrow: 1, fontFamily: 'Poppins', fontWeight: 'bold' }}>
          AutoWhapp
        </Typography>
        <IconButton className={iconButtonClasses}>
          <HelpOutlineIcon className="text-gray-900" />
        </IconButton>
        <IconButton className={iconButtonClasses}>
          <SettingsIcon className="text-gray-900" />
        </IconButton>
        <IconButton className={`${iconButtonClasses} mr-0`}>
          <PersonOutlineIcon className="text-gray-900" />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
